Fixed `soot.jbco.jimpleTransformations.LibraryMethodWrappersBuilder` that could produce incomplete methods.
Let's pretend we have the following code:
```java
public class CustomWatcher implements android.text.TextWatcher {
    // code
    @Override
    public void afterTextChanged(android.text.Editable editable) {
        if (editable.toString().equals("something")) {
            return;
        }
        // code
    }
}
```
Expression `editable.toString()` is `invokeinterface`. Method `soot.jimple.InvokeExpr#getMethod` returns `Object#toString()` that is absolutely correct because jar was compiled with `android-api.jar` (not the implementation). So in this case expression `editable.toString()` is not `invokeinterface` anymore, but `invokevirtual`. But `LibraryMethodWrappersBuilder` treated it as `invokeinterface` that led to runtime exception. As exception was ignored the transformer left new generated method incomplete.
Another problem in this case is incorrect treating with API methods: if we allow `LibraryMethodWrappersBuilder` replace `invokeinterface` with `invokevirtual` that will lead to replacing `android.text.Editable#toString()` with `Object#toString()` that is wrong.
So my solution is checking if we "lose" interface (and find class instead) and skip this transformation

---
Also I added `@Deprecated` annotation to `soot.jbco.IJbcoTransform#out` (will be replace with logger), `soot.jbco.IJbcoTransform#output` (added `soot.jbco.IJbcoTransform#isVerbose` method that gets state at runtime) and `soot.jbco.IJbcoTransform#debug`  (added `soot.jbco.IJbcoTransform#isDebugEnabled` method that gets state at runtime)

In cases like the following:

unknown $u11, $u8#22
$u11 := @parameter0: java.lang.Object;
$u8#19 = $u11 instanceof java.lang.Object[];
if $u8#19 == 0 goto label12;
$u8#22 = $u11[0];
if $u8#22 == null goto label06;

UseChecker would identify $u11 as an Object type but would fail to identify
$u8#22 as a Object[] type because its only use was in the if check against
null. This resulted in a NullPointerException as the variable that was
supposed to contain the base type of the array reference was never set.

However, it is already known that $u11 is of type Object. Thus by setting the
base type of the array ref to the already resolved type of local $u11 at the
beginning, we resolve the NullPointerException and still allow for the type
to be changed if more information is discovered through use analysis.

# Overview
The soot call graph implementation is pretty slow especially with apps that make massive use of Lambda expressions, because every Lambda expression is implemented as anonymous inner class. Therefore the class hierarchy of `Runnable` and similar classes can get extremely large.

This pull request contains a patch with can reduce the call graph generation time by 10 to 600% depending on the app and the number of available CPU cores.

# In Detail
While analyzing several Android apps I encountered some that require a lot of time (com.ubercab.driver 6h and com.google.android.googlequicksearchbox 13 h) for generating a simple CHA call graph. Using VisualVM I found out that `FastHierarchy.canStoreClass(..)` takes up to 95% of the used CPU cycles - in detail the following loop and the contained calls to `it.hasNext()` and `it.next()` take the majority:

```
      for (Iterator<SootClass> it = impl.iterator(); it.hasNext();) {
        parentInterval = classToInterval.get(it.next());
        if (parentInterval != null && parentInterval.isSubrange(childInterval)) {
          return true;
        }
      }
```

I replaced this loop using the Java stream API wich allows to perform the task in multiple threads. Further tests showed that always using the parallel approach can slow down the generation of certain apps. Therefore in the end I end up in a mixed-approach wich is pretty easy thanks to the Java stream api:

If `impl` has less than 1000 elements the sequential approach is used, if there are more elements the multi-threaded parallel approach is used.

In the end the call graph generation time was reduced from 6 to about 1 hour and from 13 to about 2 hours.

BTW: In my tests the sequential approach was already 10 to 20% faster than the for loop plus iterator (Oracle Java 8.0_171).

